import './App.css';
import Navigation from './Components/Navigation';
import LoginForm from './Components/LoginForm';
import Footer from './Components/Footer';

function App() {
  return (
    <div className="App">
      <Navigation />
      <LoginForm />
      <Footer />
    </div>
  );
}

export default App;
